import React from "react";
import "./App.css";
import { Layout, Header, Navigation, Drawer, Content } from "react-mdl";
import Main from "./components/Main";
import { Link } from "reacr-router-dom";

function App() {
  return (
    <div style={{ height: "100vh", position: "relative" }}>
      <Layout
        style={{
          background:
            "url(http://www.getmdl.io/assets/demos/transparent.jpg) center / cover"
        }}
      >
        <Header transparent title="Title" style={{ color: "white" }}>
          <Navigation>
            <Link to="/">Link</Link>
            <Link to="/">Link</Link>
            <Link to="/">Link</Link>
            <Link to="/">Link</Link>
          </Navigation>
        </Header>
        <Drawer title="Title">
          <Navigation>
            <Link to="/">Link</Link>
            <Link to="/">Link</Link>
            <Link to="/">Link</Link>
            <Link to="/">Link</Link>
          </Navigation>
        </Drawer>
        <Content>
          <Main />
        </Content>
      </Layout>
    </div>
  );
}

export default App;
